import {makeAutoObservable} from "mobx";

export default class OrderStore{
    constructor() {
        this._orders = [
            {id:1},
            {id:2},
            {id:3},
        ]
        makeAutoObservable(this)
    }

    setOrders(order){
        this._orders = order
    }

    get orders() {
        return this._orders
    }
}
